import { useEffect, useState } from "react"
import { getPoints } from "../services/API.js";

export default function HomePage() {
    const [points, setPoints] = useState([]);
    useEffect(() => {
        getPoints.then((response)=>{
            setPoints(response.data);
        })
    },[]);

    console.log(points);

    return (
        <>HomePage</>
    )
}
